import React from "react";
import Footer from "../../components/Footer";
import Header from "../../components/Header";
import OrderPage from "../../components/OrderPage";

import "./Order.css";

export const Order = () => {
  return (
    <>
      <Header />
      <OrderPage />
      <Footer />
    </>
  );
};

export default Order;
